Then $\tan \theta = \frac{y}{x - 16}$ and $\tan \phi = \frac{y}{16}.$  Then
\[\tan \angle APD = \tan (\theta + \phi) = \frac{\tan \theta + \tan \phi}{1 - \tan \theta \tan \phi}.\]We want to solve
\[\frac{\tan \theta + \tan \phi}{1 - \tan \theta \tan \phi} = 3.\]From $\tan \theta = \frac{y}{x - 16}$ and $\tan \phi = \frac{y}{16},$ this becomes
\[\frac{\frac{y}{x - 16} + \frac{y}{16}}{1 - \frac{y^2}{16(x - 16)}} = 3.\]Then
\[\frac{y(x - 16) + \frac{y(x - 16)}{16}}{16(x - 16) - y^2} = 3.\]Simplifying this, we get
\[y^2 + 48y - x^2 + 256 = 0.\]We want to solve for $x,$ so let's eliminate $y.$

From $\tan \theta = \frac{y}{x - 16},$
\[\cos \theta = \frac{x - 16}{\sqrt{x^2 + y^2}}.\]From $\tan \phi = \frac{y}{16},$
\[\cos \phi = \frac{16}{\sqrt{x^2 + y^2}}.\]Hence,
\begin{align*}
\cos (\theta + \phi) &= \cos \theta \cos \phi - \sin \theta \sin \phi \\
&= \frac{(x - 16)(16)}{x^2 + y^2} - \frac{y}{\sqrt{x^2 + y^2}} \\
&= \frac{16x - 16^2 - y^2}{x^2 + y^2}.
\end{align*}Also, $\cos^2 (\theta + \phi) = \frac{1}{1 + \tan^2 (\theta + \phi)} = \frac{1}{10}.$  Hence,
\[\frac{(16x - 16^2 - y^2)^2}{(x^2 + y^2)^2} = \frac{1}{10}.\]Then
\[(16x - 16^2 - y^2)^2 = \frac{x^2 + y^2}{10}.\]Substituting $y^2 + 48y - x^2 + 256$ for $y^2,$ we get
\[(16x - 16^2 - y^2)^2 = \frac{x^2 + (y^2 + 48y + 256)}{10}.\]Hence,
\[(16x - 16^2 - y^2)^2 = \frac{x^2 + (y + 24)^2}{10}.\]This simplifies to
\[39x^2 - 960x - 8320 = 0.\]This factors as $39(x - 80)(x + 26),$ so $x = \boxed{80}.$

