Let the yard have side length $6$.  A diagram of a third of the yard is shown above, as is a diagram of the larger region that Fido is able to visit.  Note that since the leash is half as long as the side length, its length is $3$.

A region $A$ Fido cannot reach is shaded in the diagram above.  Fido can explore a region enclosed by a sector of a circle with area $\frac{120^\circ}{360^\circ}\cdot 9\pi=3\pi$, as well as two regions $B$ defined by two other such sectors and an equilateral triangle $MPC$ of which the area is $\frac{1}{4}\cdot3\cdot3=\frac{9}{4}$.  As can be seen in the small diagram, the area of region $A$ equals the area enclosed by arc $\overarc{AB}$ minus rectangle $AC$ plus the areas of the two triangles $BMP$ and $CMP$.  Let $P$ be the intersection of line $MB$ and line $AC$; it is clear that triangles $BMP$ and $CMP$ are congruent by SAS.  Then, setting $AC=6y$ and $AM=3+x$, we have $y-3=\frac{x}{\sqrt{3}\ }$, whence $x=\sqrt{3}(3-y)$.  Then by the Pythagorean Theorem, $9=y^2+(3\sqrt{3}-3y)^2\Longrightarrow y^2+(9\cdot3-18y+y^2)=9\Longrightarrow y=5$.

Further computations yield that $MB=MC=2\sqrt{3}$; hence $P$ is the centroid of equilateral triangle $MBC$.  Since the medians of a triangle are cut into segments with ratio $1\mathrm{:}2$, the ratio of the area of triangle $ACB$ to the triangles $BMP$ and $CMP$ is $2\mathrm{:}1$. However, region $A$ has an area equal to the area of rectangle $AC$ minus the area enclosed by arc segment $\overarc{AB}$.  Let the vertices of region $ACB$ be labelled clockwise, with $A$ at the top vertex, $B$ at the lower-left vertex, and $C$ at the lower-right vertex.

Since two-thirds of the parallelogram in the large diagram are yard, one-third of the parallelogram in the large diagram are yard that Fido cannot reach.  Thus, $\frac{1}{3}\cdot 3\pi+2\cdot[\triangle BMP]+[\triangle CMP]=\frac{1}{3}\cdot 9\pi+\frac{1}{3}\cdot \frac{9}{4}\Longrightarrow \pi(3-2)\cdot[\triangle ACB]+\frac{2}{3}\cdot 6y$.  Finally clearing denominators and cancelling $\pi$s, we are left with $9-6=9\cdot 6\cdot\frac{2}{3}-3\cdot 6\cdot\frac{4}{3}$.  Since this expression is true, it follows that the fraction of the yard that Fido can reach is $\boxed{\frac{\sqrt{3}}{4}\pi}$, and $a\cdot b= \boxed{12}$.

