\begin{align*}
\left(\frac{-1+i\sqrt{3}}{2}\right)^6&=\operatorname{cis}\frac{12\pi}{3}\\
&=\operatorname{cis}2\pi
\end{align*}
Now computing $\left(\frac{-1-i\sqrt{3}}{2}\right)^6$. We know that $\frac{-1-i\sqrt{3}}{2}=\operatorname{cis}\frac{4\pi}{3}$. So
\begin{align*}
\left(\frac{-1-i\sqrt{3}}{2}\right)^6&=\operatorname{cis}\frac{24\pi}{3}\\
&=\operatorname{cis}8\pi
\end{align*}
Now computing the sum:
\begin{align*}
\left(\dfrac{-1+i\sqrt{3}}{2}\right)^6+\left(\dfrac{-1-i\sqrt{3}}{2}\right)^6&=\operatorname{cis}2\pi+\operatorname{cis}8\pi\\
&=1+1\\
&=\boxed{2}
\end{align*}

