We can rewrite the equation $y=2x$ as $x=\frac{1}{2}y$. So, the set of all points $(x,y)$ where one coordinate is exactly twice the other consists of all points that satisfy this equation. Thus, the graph is the set of all points $(x,y)$ that lie on the line $x=\frac{1}{2}y$. 

To graph this line, we can start by plotting a few points that lie on the line. For example, we can set $y=0$ and find that $x=0$. So, $(0,0)$ lies on the line. We can also set $y=2$ and find that $x=1$. So, $(1,2)$ lies on the line. 

We can then connect these points to get the line. 

[asy]
import graph;
size(100,100);
xaxis(-5, 5);
yaxis(-5, 5);
real f(real x) {return 0.5*x;}
draw(graph(f,-5,5),linewidth(1));
dot((0,0));
dot((1,2));
[/asy]

This line splits the plane into two regions, one above the line and one below the line. Therefore, the graph of all points $(x,y)$ where one coordinate is exactly twice the other splits the plane into $\boxed{2}$ regions.

