The midpoints of the diagonals must coincide. The midpoint of $\overline{(1,-5),(11,7)}$ is $\left(\frac{1+11}{2},\frac{-5+7}{2}\right)=(6,1).$
[asy]
size(4cm);
pair A,C,O,B;
A = (1,-5);
C = (11,7);
O = (A+C)/2;
B = 2*O-A;
draw(A--B--C--A);
draw(B--O,dashed);
label("$A$",A,SW);
label("$C$",C,NE);
label("$O$",O,dir(0));
label("$B$",B,SE);
[/asy] Thus the other diagonal must pass through $O$ (shown as a dot above).   That's the intersection of $\overline{(1, -5), (11,7)}$ and $\overline{(11, -5), (1,7)}$. That's easy to find using point-slope: \begin{align*}
\text{slope} &= \frac{7-(-5)}{11-1} = \frac{6}{5}, \\
y-7 &= \frac{6}{5}(x-11), \\
y &= \frac{6}{5}x + 1.
\end{align*}When $y=-5$, we have $-5=\frac{6}{5}x+1$, so $x=-6$.  Thus, $O=(-6,-5),$ and $\boxed{(-6,-5)}$ is our answer.

The graph of $|x-3| = y$ is a V-shape with vertex $(3,0)$. The graph of $y = 4 - |x-1|$ is a V-shape with vertex $(1,0)$. We graphed these two V-shapes below along with a sketch of the region that satisfies both $|x-3|\le y$ and $y \le 4-|x-1|$.


[asy]
