The region that satisfies both inequalities is the triangle with vertices $(0,0)$, $(3,0)$, and $(1,3)$. This triangle has base $3-1=2$ and height $3$. Hence, the area of the triangle is $\frac{1}{2}(2)(3)=\boxed{3}$.

