fill((-8,6)--(-3,1)--(1,1)--cycle,gray(0.7));
fill((2,-1)--(2,3)--(8,1)--cycle,gray(0.7));
draw((-8,6)--(-3,1)--(1,1)--(8,1));
draw((-2,-1)--(-2,9),dashed);

label("$x$", (10,0), E);
label("$y$", (0,10), N);
[/asy]

This defines a region that is $\boxed{\boxed{\text{never}}}$ true.

Putting it all together, the region that satisfies both inequalities is shown below.  The region is partitioned by the line $x = 3$.

[asy]
unitsize(1 cm);

fill((0,0)--(-1,3)--(3,3)--(6,0)--cycle,gray(0.7));

draw((-4,4)--(20,10),dashed);
draw((-4,14)--(20,-2),dashed);
draw((-2,-1)--(-2,9),dashed);

draw((-6,0)--(6,0));
draw((0,-2)--(0,5));

label("$x$", (6,0), E);
label("$y$", (0,5), N);

draw((0,0)--(-1,3)--(3,3)--(6,0));
draw((6,0)--(-1,3)--(0,0));
[/asy]

The area of the region is the sum of the areas of the two shaded pentagons.  If we divide these pentagons by the dash lines, we get two triangles, with bases 2 and 3 and height 3.  The combined area of the two pentagons is then $[(2 + 3)/2] \cdot 3 = \boxed{\frac{15}{2}}.$

solution:
Plotting $y = |x - 3|$ and $y = 4 - |x - 1|,$ we find that the two graphs intersect at $(0,3)$ and $(4,1).$


[asy]
