Find the perimeter of triangle $ABC$.

solution:
Join $PQ$, $PR$, $PS$, $RQ$, and $RS$. Since the circles with centers $Q$, $R$ and $S$ are all tangent to $BC$, then $QR$ and $RS$ are each parallel to $BC$ (as the centers $Q$, $R$ and $S$ are each 1 unit above $BC$). This tells us that $QS$ passes through $R$.

Similarly, since $P$ and $S$ are each one unit from $AC$, then $PS$ is parallel to $AC$. Also, since $P$ and $Q$ are each one unit from $AB$, then $PQ$ is parallel to $AB$. Therefore, the sides of $\triangle PQS$ are parallel to the corresponding sides of $\triangle ABC$.


When the centers of tangent circles are joined, the line segments formed pass through the associated point of tangency, and so have lengths equal to the sum of the radii of those circles. Therefore, $QR=RS=PR=PS=1+1=2$.

[asy]
size(200);
pair P, Q, R, S;
Q=(0,0);
R=(2,0);
S=(4,0);
P=(3,1.732);
label("Q", Q, SW);
label("R", R, dir(270));
label("S", S, SE);
label("P", P, N);
draw(circle(Q,1), dashed);
draw(circle(P,1), dashed);
draw(circle(R,1), dashed);
draw(circle(S,1), dashed);
draw(P--Q--S--P--R);
[/asy]

Since $PR=PS=RS$, we know $\triangle PRS$ is equilateral, so $\angle PSR=\angle PRS=60^\circ$. Since $\angle PRS=60^\circ$ and $QRS$ is a straight line, we have $\angle QRP=180^\circ-60^\circ=120^\circ$.

Since $QR=RP$, we know $\triangle QRP$ is isosceles, so $$\angle PQR = \frac{1}{2}(180^\circ-120^\circ)= 30^\circ.$$Since $\angle PQS=30^\circ$ and $\angle PSQ=60^\circ$, we have $$\angle QPS = 180^\circ - 30^\circ - 60^\circ = 90^\circ,$$so $\triangle PQS$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle.

The angles of $\triangle ABC$ are equal to the corresponding angles of $\triangle PQS$, so $\triangle ABC$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle. This means that if we can determine one of the side lengths of $\triangle ABC$, we can then determine the lengths of the other two sides using the side ratios in a $30^\circ$-$60^\circ$-$90^\circ$ triangle.

Consider side $AC$. Since the circle with center $P$ is tangent to sides $AB$ and $AC$, the line through $A$ and $P$ bisects $\angle BAC$.  Thus, $\angle PAC=45^\circ$. Similarly, the line through $C$ and $S$ bisects $\angle ACB$.  Thus, $\angle SCA=30^\circ$. We extract trapezoid $APSC$ from the diagram, obtaining

[asy]
size(200);
pair A, P, S, C, Z, X;
C=(0,0);
Z=(1.732,0);
X=(3.732,0);
A=(4.732,0);
S=(1.732,1);
P=(3.732,1);
draw(A--X--Z--C--S--P--A);
draw(S--Z);
draw(P--X);
label("A", A, SE);
label("Z", Z, dir(270));
label("X", X, dir(270));
label("C", C, SW);
label("S", S, NW);
label("P", P, dir(45));
label("1", (S+Z)/2, E);
label("1", (X+P)/2, E);
label("2", (S+P)/2, N);
draw((1.732,.15)--(1.882,.15)--(1.882,0));
draw((3.732,.15)--(3.582,.15)--(3.582,0));
label("$30^\circ$", (.35,.15), E);
label("$45^\circ$", (4.5,.15), W);
[/asy]

Drop perpendiculars from $P$ and $S$ to $X$ and $Z$, respectively, on side $AC$. Since $PS$ is parallel to $AC$, and $PX$ and $SZ$ are perpendicular to $AC$, we know that $PXZS$ is a rectangle, so $XZ=PS=2$.

Since $\triangle AXP$ is right-angled at $X$, has $PX=1$ (the radius of the circle), and $\angle PAX=45^\circ$, we have $AX=PX=1$. Since $\triangle CZS$ is right-angled at $Z$, has $SZ=1$ (the radius of the circle), and $\angle SCZ=30^\circ$, we have $CZ=\sqrt{3}SZ=\sqrt{3}$ (since $\triangle SZC$ is also a $30^\circ$-$60^\circ$-$90^\circ$ triangle). Thus, $AC=1+2+\sqrt{3}=3+\sqrt{3}$.

Since $\triangle ABC$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle, with $\angle ACB=60^\circ$ and $\angle CAB=90^\circ$, we have $BC=2AC=6+2\sqrt{3}$, and $$AB=\sqrt{3}AC=\sqrt{3}(3+\sqrt{3})=3\sqrt{3}+3.$$Therefore, the side lengths of $\triangle ABC$ are $AC=3+\sqrt{3}$, $AB=3\sqrt{3}+3$, and $BC=6+2\sqrt{3}$. Thus, the perimeter is $$3+\sqrt{3}+3\sqrt{3}+3+6+2\sqrt{3}=\boxed{12+6\sqrt{3}}.$$

problem:
Let \[f(x) = \left\{
\begin{array}{cl}
-x - 3 & \text{if } x \le 1, \\
\frac{x}{2} + 1 & \text{if } x > 1.
