pair A, B, C, D, P, Q, R;

A = (0,0);
B = (1,0);
C = (2,0);
D = (3,0);
Q = (1,3);
R = (2,2);
P = intersectionpoints(circumcircle(A,Q,C),circumcircle(B,R,D))[0];

draw(A--D);
//draw(circumcircle(A,Q,C));
//draw(circumcircle(B,R,D));
draw(A--P--D);
draw(P--B);
draw(P--C);
