Note that right triangles $OQP$ and $OPV$ are similar, so
\[\frac{OQ}{OP} = \frac{OP}{OV} = \frac{5}{7}.\]Then
\[\frac{\|\mathbf{q}\|}{\|\mathbf{v}\|} = \frac{OQ}{OV} = \frac{OQ}{OP} \cdot \frac{OP}{OV} = \boxed{\frac{25}{49}}.\]

