A sphere is inscribed in a right cone with base radius $12$ cm and height $24$ cm, as shown. The radius of the sphere can be expressed as $a\sqrt{c} - a$ cm. What is the value of $a + c$? [asy]
import three; size(120); defaultpen(linewidth(1)); pen dashes = linetype("2 2") + linewidth(1);
currentprojection = orthographic(0,-1,0.16);
void drawticks(triple p1, triple p2, triple tickmarks) {

draw(p1--p2); draw(p1 + tickmarks-- p1 - tickmarks); draw(p2 + tickmarks -- p2 - tickmarks);
}
real r = 6*5^.5-6;
triple O = (0,0,0), A = (0,0,-24);
draw(scale3(12)*unitcircle3); draw((-12,0,0)--A--(12,0,0)); draw(O--(12,0,0),dashes);
draw(O..(-r,0,-r)..(0,0,-2r)..(r,0,-r)..cycle);
draw((-r,0,-r)..(0,-r,-r)..(r,0,-r)); draw((-r,0,-r)..(0,r,-r)..(r,0,-r),dashes);

drawticks((0,0,2.8),(12,0,2.8),(0,0,0.5));
drawticks((-13,0,0),(-13,0,-24),(0.5,0,0));
label("$12$", (6,0,3.5), N); label("$24$",(-14,0,-12), W);
[/asy]

solution:
Consider a cross-section of the cone that passes through the apex of the cone and the center of the circular base. It looks as follows: [asy] defaultpen(linewidth(1) + fontsize(10)); size(120); pen dashes = linetype("2 2") + linewidth(1); real r = 6*5^.5 - 6;
pair A = (0,-24), O = (0,0), C = (0,-r), P = foot(C,(12,0),A); draw(circle(C,r)); draw((-12,0)--A--(12,0)--cycle); draw(O--A, dashes); dot(C); draw(C--P,dashes); draw(rightanglemark(C,P,A));

label("$A$",A,S); label("$B$",(-12,0),N); label("$C$",(12,0),N); label("$D$",O,N); label("$O$",C,W); label("$P$",P,SE);
[/asy] Let $O$ be the center of the sphere (or the center of the circle in the cross-section), let the triangle be $\triangle ABC$, so that $D$ is the midpoint of $BC$ and $A$ is the apex (as $\triangle ABC$ is isosceles, then $\overline{AD}$ is an altitude). Let $P$ be the point of tangency of the circle with $\overline{AC}$, so that $OP \perp AC$. It follows that $\triangle AOP \sim \triangle ACD$. Let $r$ be the radius of the circle. It follows that $$\frac{OP}{AO} = \frac{CD}{AC} \implies OP \cdot AC = AO \cdot CD.$$We know that $CD = 12$, $AC = \sqrt{12^2 + 24^2} = 12\sqrt{5}$, $OP = r$, and $AO = AD - OP = 24 - r$. Thus, $$12r\sqrt{5} = 12(24-r) = 12^2 \cdot 2 - 12r \implies 12r(1 + \sqrt{5}) = 12^2 \cdot 2.$$Thus, $r = \frac{24}{1+\sqrt{5}}$. Multiplying the numerator and denominator by the conjugate, we find that $$r = \frac{24}{1+\sqrt{5}} \cdot \frac{\sqrt{5} - 1}{\sqrt{5} - 1} = \frac{24(\sqrt{5} - 1)}{5 - 1} = 6\sqrt{5} - 6.$$It follows that $a+c = \boxed{11}$.

The equation
\[\bold{v} = \begin{pmatrix} 2 \\ -3 \\ -3 \end{pmatrix} + \begin{pmatrix} 7 \\ 5 \\ -1 \end{pmatrix} t = \begin{pmatrix} 2 + 7t \\ -3 + 5t \\ -3 - t \end{pmatrix}\]describes a line, so if $\bold{v}$ is the vector that is closest to $\bold{a}$, then the vector joining $\bold{v}$ and $\bold{a}$ is orthogonal to the direction vector of the line.

[asy]
unitsize (0.6 cm);

pair A, B, C, D, E, F, H;

A = (2,5);
B = (0,0);
C = (8,0);
D = (A + reflect(B,C)*(A))/2;

draw(A--D);
draw((0,0)--(8,0));

dot("$\mathbf{a}$", A, N);
dot("$\mathbf{v}$", D, S);
[/asy]

This gives us the equation
\[\left( \begin{pmatrix} 2 + 7t \\ -3 + 5t \\ -3 - t \end{pmatrix} - \begin{pmatrix} 4 \\ 4 \\ 5 \end{pmatrix} \right) \cdot \begin{pmatrix} 7 \\ 5 \\ -1 \end{pmatrix} = 0.\]Then
\[\begin{pmatrix} -2 + 7t \\ -7 + 5t \\ -8 - t \end{pmatrix} \cdot \begin{pmatrix} 7 \\ 5 \\ -1 \end{pmatrix} = 0,\]so $(-2 + 7t) \cdot 7 + (-7 + 5t) \cdot 5 + (-8 - t) \cdot (-1) = 0$.  Solving for $t$, we find $t = \boxed{\frac{41}{75}}.$

To find the distance between the lines, we find a vector from a point on one line to a point on the other.  Below, we have the two lines, and the projection:

[asy]
usepackage("amsmath");

unitsize(0.4 cm);

pair A, B, P;

A = (1,4);
B = (-5,6);
P = (A + reflect(B, B + (4,3))*(A))/2;

draw((A + (4,3))--(A - 2*(4,3)));
draw((B + 2*(4,3))--(B - (4,3)));
draw(B--P,linewidth(2*bp),Arrow(8));
draw(B--A,Arrow(8));
draw(A--P,dashed);
draw((-5,10)--((-5,10) + (4,3)),Arrow(8));

dot("$\mathbf{a} = \begin{pmatrix} 2 \\ -3 \end{pmatrix}$", A, SE);
dot("$\mathbf{b} = \begin{pmatrix} 1 \\ -5 \end{pmatrix}$", B, NW);
label("$\mathbf{a} + t \mathbf{d}$", A + (4,3), E);
label("$\mathbf{b} + s \mathbf{d}$", B + 2*(4,3), E);
label("$\mathbf{v}$", (A + B)/2, S);
label("$\mathbf{p}$", (B + P)/2, NW);
label("$\mathbf{d}$", (-5,10) + 0.5*(4,3), NW);
dot("$\mathbf{c}$", P, NW);
[/asy]

Let $\bold{a} = \begin{pmatrix} 2 \\ -3 \end{pmatrix}$, $\bold{b} = \begin{pmatrix} 1 \\ -5 \end{pmatrix}$, and $\bold{d} = \begin{pmatrix} 1 \\ -7 \end{pmatrix}$.  Let $\bold{v} = \bold{a} - \bold{b} = \begin{pmatrix} 1 \\ 2 \end{pmatrix}$.

Letting $\bold{p}$ be the projection of $\bold{v}$ onto $\bold{d}$, we have
\begin{align*}
\bold{p} &= \text{proj}_{\bold{d}} \bold{v} \\
&= \frac{\bold{v} \cdot \bold{d}}{\bold{d} \cdot \bold{d}} \bold{d} \\
&= \frac{\begin{pmatrix} 1 \\ 2 \end{pmatrix} \cdot \begin{pmatrix} 1 \\ -7 \end{pmatrix}}{\begin{pmatrix} 1 \\ -7 \end{pmatrix} \cdot \begin{pmatrix} 1 \\ -7 \end{pmatrix}} \begin{pmatrix} 1 \\ -7 \end{pmatrix} \\
&= -\frac{13}{50} \begin{pmatrix} 1 \\ -7 \end{pmatrix} \\
&= \begin{pmatrix} -\frac{13}{50} \\ \frac{91}{50} \end{pmatrix}.
\end{align*}Thus, if $\bold{c} = \bold{b} + \bold{p}$, then the vector joining $\bold{a}$ and $\bold{c}$ is orthogonal to $\bold{d}$.  We have that
\[\bold{c} = \begin{pmatrix} 1 \\ -5 \end{pmatrix} + \begin{pmatrix} -\frac{13}{50} \\ \frac{91}{50} \end{pmatrix} = \begin{pmatrix} \frac{37}{50} \\ -\frac{159}{50} \end{pmatrix},\]so the distance between the two parallel lines is
\[\left\| \begin{pmatrix} 2 \\ -3 \end{pmatrix} - \begin{pmatrix} \frac{37}{50} \\ -\frac{159}{50} \end{pmatrix} \right\| = \left\| \begin{pmatrix} \frac{63}{50} \\ \frac{9}{50} \end{pmatrix} \right\| = \boxed{\frac{9 \sqrt{2}}{10}}.\]

