label("$1$", P, SE);
label("$\omega$", Q, NE);
label("$1$", (O + P)/2, S, red);
label("$1$", (O + Q)/2, NW, red);
[/asy]

Thus, the distance between 1 and $\omega$ is $|\omega - 1| = 2 \sin \frac{\pi}{12} = \frac{\sqrt{6} - \sqrt{2}}{2},$ so
\[|z| = \frac{2016}{\frac{\sqrt{6} - \sqrt{2}}{2}} =\frac{4032}{\sqrt{6} - \sqrt{2}} = \frac{4032 (\sqrt{6} + \sqrt{2})}{4} = \boxed{1008 \sqrt{6} + 1008 \sqrt{2}}.\]

problem:
Sector $OAB$ is a quarter of a circle of radius 3 cm. A circle is drawn inside this sector, tangent at three points as shown. What is the number of centimeters in the radius of the inscribed circle? Express your answer in simplest radical form. [asy]
